import React from 'react'
import Head from 'next/head';

const Blog = ({Component}) => {
    return(
        <>
        <Head>
            <title>EASYHO Blog</title>
        </Head>
        <div>
           <Component/>
        </div>
        </>
    )
}

export default Blog;
